def vnchmap(c):
  if ord(c) >= len(vn_map):
    return ord(c)
  return vn_map[ord(c)]

def wchcmp(c1, c2):
  if c1 == c2:
    return 0;
  return -1 if vnchmap(c1) < vnchmap(c2) else 1

def wscmp(s1, s2):
  for i in range(len(s1)):
    if i >= len(s2):
      return 1
    if s1[i] == s2[i]:
      continue
    if vnchmap(s1[i]) > vnchmap(s2[i]):
      return 1
    elif vnchmap(s1[i]) < vnchmap(s2[i]):
      return -1
  if len(s1) < len(s2):
    return -1;
  return 0
